webpackJsonp([0x15b57d22bc39f700],{"./node_modules/json-loader/index.js!./.cache/json/typography-font-weight-and-style.json":function(t,n){t.exports={data:{markdownRemark:{html:'<h2>Font Weight and Style</h2>\n<p>Font-weight can be written as text values:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>font-weight: normal;\nfont-weight: bold;</code></pre>\n      </div>\n<p>Or as a numerical value from <code>100</code> to <code>900</code> (in multiples of 100):</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>font-weight: 400;  /* equal to \'normal\' above */\nfont-weight: 700; /* equal to \'bold\' above */</code></pre>\n      </div>\n<p>Numerical value and their common description</p>\n<table>\n<thead>\n<tr>\n<th>Value</th>\n<th>Common Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>100</td>\n<td>Thin (Hairline)</td>\n</tr>\n<tr>\n<td>200</td>\n<td>Extra Light (Ultra Light)</td>\n</tr>\n<tr>\n<td>300</td>\n<td>Light</td>\n</tr>\n<tr>\n<td>400</td>\n<td>Normal</td>\n</tr>\n<tr>\n<td>500</td>\n<td>Medium</td>\n</tr>\n<tr>\n<td>600</td>\n<td>Semi Bold (Demi Bold)</td>\n</tr>\n<tr>\n<td>700</td>\n<td>Bold</td>\n</tr>\n<tr>\n<td>800</td>\n<td>Extra Bold (Ultra Bold)</td>\n</tr>\n<tr>\n<td>900</td>\n<td>Black (Heavy)</td>\n</tr>\n</tbody>\n</table>\n<p>Not all weights are available for all fonts. Some specialised fonts may only be available in one weight (generally <code>normal</code> <code>400</code>).</p>\n<p>Font-weight can also be specified relative to an elementâ€™s parent (if a font has more than one weight):</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>font-weight: lighter; \nfont-weight: bolder; </code></pre>\n      </div>',fields:{slug:"/typography/font-weight-and-style/"},frontmatter:{title:"Font Weight and Style"}}},pathContext:{slug:"/typography/font-weight-and-style/"}}}});
